import React, { Component } from 'react';

class NavBar extends Component {

    state={
        news:[
          "Cyclone Amphan led to $14 billion economic losses, says global report ",
          "NEWS Item 2 ",
          "NEWS Item 3 ",
          "NEWS Item 4 ",
          "NEWS Item 5 ",
          "NEWS Item 6 ",
          "NEWS Item 7 ",
          "NEWS Item 8 ",
          "NEWS Item 9 ",
          "NEWS Item 10 "
        ]
    }

    shouldComponentUpdate(){
        return false;
    }

    render() {
      let NEWS = this.state.news.join("\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0");
        return (
            <nav className="navbar navbar-expand-lg bg-dark navbar-dark">
            <marquee style={{color: 'white'}}> {NEWS} </marquee>
            </nav>
        );
    }
}

export default NavBar;
